function getCookie(name) {
  // Split all the cookies into an array
  const cookies = document.cookie.split(";");
  // Loop through the cookies array
  for (let i = 0; i < cookies.length; i++) {
    // Split the cookie into its name and value
    const cookie = cookies[i].trim().split("=");

    // Check if the cookie name matches the provided name
    if (cookie[0] === name) {
      // Return the cookie value
      return decodeURIComponent(cookie[1]);
    }
  }
  // If the cookie is not found, return null
  return null;
}

function isMobile() {
  try {
    const mediaQuery = window.matchMedia("(max-width: 767px)");

    // Check if the media query matches
    if (mediaQuery.matches) {
      return "mweb"
    } else {
      return "web"
    }
  } catch(e) {
    return "indeterministic"
  }

}

const platform = isMobile();
const tracker = getCookie("trackerid");
var data = JSON.stringify({
  "app": "NS_Container",
  "ua": navigator.userAgent,
  tracker,
  "ekind": "custom_event_page_loaded_homepage",
  "okind": "tracker",
  "oid": tracker,
  "edata": {},
  "odata": {
    "url": window.location.href
  }
})

var xhr = new XMLHttpRequest();
xhr.withCredentials = true;

xhr.open("POST", "https://www.acko.com/api/r2d2/");
xhr.setRequestHeader("x-platform", platform);

xhr.send(data);

